import React from "react";
import "../Components/style.css";

const About = () => {
  return (
    <div className="page-container">
      <h1>About Us</h1>
      <p>
        Welcome to our project! Our mission is to provide a user-friendly microgrid design tool that empowers users to efficiently plan and optimize energy solutions. Learn more about our team, our values, and our journey.
      </p>
    </div>
  );
};

export default About;
